import { title } from "process";
import HeaderBG from "../HeaderBackground/HeaderBG";

function WorkshopRoom() {
  const bg = {
    title: 'PHÒNG HỘI NGHỊ',
    img: '/images/workshop-bg.jpg',
  };
  return (<>
    <HeaderBG {...bg}/>
  </>);
}
export default WorkshopRoom;
